import './steps.scss'
const Steps = () => {
  return (
    <div className="App">
      <div className="steps">
        <div className="steps__container">
            <div className="steps__container__item"></div>
            <span className="steps-line"></span>
        </div>
      </div>
    </div>
  );
};

export default Steps;
